import './App.css';

function App() {
  return (
    <>
    <div className='signIn h-screen block rounded-xl px-8 py-20' >
      <img className='max-w-52' src={require("./insta.png")} />
      <form className='flex flex-col text-gray-500 text-xs'>
        <label htmlFor="username">Phone number, username, or email</label>
        <input type="text" />
        <label htmlFor="username">Password</label>
        <input type="password" />
      </form>

    </div>
    </>

  );
}

export default App;
